import React from 'react';

const Input = props => (
  <div>
    <div style={{ marginBottom: 5 }}>{props.text}</div>
    <input
      required="required"
      name={props.name}
      type={props.type}
      placeholder={props.placeholder ? props.placeholder : props.name}
      onChange={props.handleInputChange}
    />
  </div>
);

export default Input;
